Page._content:
Ciallo! Welcome to my little corner of the Internet!

Im  (Hiedano Ajuu) - a high school student from Nanjing, China.
Here youll find a blend of my passions:

-  **Touhou Project Fanworks** - Dive into my stories and creations inspired by the Touhou universe and the real world.
-  **Historical Translations** - Exploring history through translations of historical texts(Mainly from English into Chinese).
-  **Computer Science Notes** - Clear, practical, simple study notes on programming and computer science.

This site is primarily in English and Simplified Chinese. 

---

 Latest Updates
- 2025-08-15: Removed [*Arch Linux Bochs*](https://hiedanoajuu.github.io/2025/05/31/bochs) (Removed for safety reasons);
- 2025-08-06: Translated [*Hello WorldMasm*](https://hiedanoajuu.github.io/2025/01/21/hello-world-masm/) into [*Implementing Hello World in MASM*](https://hiedanoajuu.github.io/2025/01/21/hello-world-masm-en/);
- 2025-08-06: Updated 2025-08-06: Updated [* (Comprehensive List of Ancient Egyptian Kings with Chronology)*](https://hiedanoajuu.github.io/2025/07/21/chronology-ancient-egypt/);

---
<blockquote id="daily-quote">Loading...</blockquote>
<script>
fetch('/quotes/quotes.json')
  .then(response => response.json())
  .then(data => {
    const today = new Date();
    const index = (today.getFullYear() * 365 + today.getMonth() * 30 + today.getDate()) % data.length;
    const q = data[index];
    document.getElementById('daily-quote').innerHTML = `"${q.quote}" <br> ${q.author}`;
  })
  .catch(() => {
    document.getElementById('daily-quote').innerHTML = "Failed to load quote.";
  });
</script>

![ (Hiedano Akyuu)](/images/akyuu.jpg " (Hiedano Akyuu)")

---
*Thanks for visiting - I hope you find something that sparks your interest!*

